import React from "react";
import items from "../../shared/itemImages";

export class ProductCard extends React.Component {
  render() {
    return items
      .find((x) => x.images)
      .images.map((img) => (
        <div className="card">
          <img src={img}></img>
        </div>
      ));
  }
}
